KISSY.use("editor", function (S, Editor) {
    var cfg = {
        // 
        focused: true,
        attachForm: true,
        // 
        // customStyle:"p{line-height: 1.4;margin: 1.12em 0;padding: 0;}",
        // 
        // customLink:["http://localhost/customLink.css","http://xx.com/y2.css"],
        // render:"#container",
        render: '#editorContainer',
        width: '80%',
        height: "400px"
    };

    KISSY.use("kg/editor-plugins//source-area," +
        "kg/editor-plugins//font-size," +
        "kg/editor-plugins//image," +
        "kg/editor-plugins//code", function (S, SourceArea, FontSize, Image, Code) {

        cfg.plugins = [SourceArea, FontSize, new Image({
            upload: {
                serverUrl: "http://localhost/kissy_git/kissy/src/editor/demo/upload.php",
                serverParams: {
                    waterMark: function () {
                        return S.one("#ke_img_up_watermark_1")[0].checked;
                    }
                },
                suffix: "png,jpg,jpeg,gif",
                fileInput: "Filedata",
                sizeLimit: 1000, //k
                extraHtml: "<p style='margin-top:10px;'><input type='checkbox' id='ke_img_up_watermark_1' checked='checked'> </p>"
            }
        }), Code];

        new Editor(cfg).render();
    });

});
